import React, { Component, useState } from 'react'
import WorkingCompo from './WorkingCompo'
import { Slider } from "@mui/material";
import { Typography } from "@mui/material";
// import { PieChart } from "react-minimal-pie-chart";
import styles from "./Calculator.module.css";
import CurrencyInput from "react-currency-input-field";

const featuresData = [{ img: "/assets/Groupbranding.svg", title: 'Personal Branding', content: 'Kuants will assist you in building your own digital brand through websites, social media and other digital assets Understand and build soft skills to become your clients trusted person' },
{ img: "/assets/Groupmarketing.png", title: 'Marketing', content: 'Keep your clients engaged by sharing with your curated content and market news build by Kuants team for your customer interactions. Videos, Blogs, Newsletter' },
{ img: "/assets/Grouptraining-and-support.svg", title: 'Training & Support', content: 'Get training on mutual funds, stock markets, IPOs etc, both online and offline with the help of our team of 200 experienced professionals to serve your clients interests in best possible manner' },]
const Partnership = () => {
    const [amount, setAmount] = useState(10000);
    const [interest, setInterest] = useState(6);
    const [tenure, setTenure] = useState(5);
    const [fdamount, setFDAmount] = useState(50000);
    const [fdinterest, setFDInterest] = useState(5);
    const [fdtime, setFDTime] = useState(6);

    const [mutual, setMutual] = useState(true);
    const [fd, setFd] = useState(false);
    const maxValue = 1000000;
    const minValue = 100;
    const maxInterest = 25;
    const minInterest = 4;
    const minfdinterest = 2.5;
    const maxfdinterest = 7.5;
    const maxTenure = 30;
    const minTenure = 1;

    const si = (fdamount * fdinterest * fdtime) / 100;
    const fdValue = Math.round(fdamount + si);
    const mfValue = Math.round(amount * (1 + interest / 100) ** tenure);
    return (
        <div className='partnership-program'>
            <div className='partnership-main'>
                <div className='p-m-left'>
                    <h2 className='heading-style-one partner-heading'>Partnerships</h2>
                    <p>Are you a CA, Investment Advisor, LIC Agent, or in investments field, looking to build a long term recurring source of income? </p>
                    <p>Partner with Kuants in easy steps to build, and scale your net worth through your network
                    </p>
                    <button className='about-btn about-btn-ios'>Join as Partner</button>
                </div>
                <img src='/assets/partner-top.svg' alt='parters-top' />

            </div>
            <div className='benefits'>
                <h2 className="heading-style-one">Benefits</h2>
                <div className="b-card-container">
                    {featuresData.map((item, index) => (
                        <div className="card" key={index}>
                            <img src={`${item.img}`} alt={`${item.title}`} />
                            <p className='card-title'>{item.title}</p>
                            <p className='card-content'>{item.content}</p>
                        </div>
                    ))}

                </div>
            </div>
            <WorkingCompo />
            <div>
                <div className={styles.calculationContainer}>
                    <div className={styles.header}>
                        <h1 className={styles.head_text}>Calculators</h1>
                    </div>


                    <div className={styles.sliderContent}>
                        {fd === false ? (
                            <Typography id={styles.principal}>SIP Amount</Typography>
                        ) : (
                            <Typography id={styles.principal}>Total Investment</Typography>
                        )}
                        <div className={styles.sipBox}>
                            <CurrencyInput
                                className={styles.sipValue}
                                value={fd === true ? fdamount : amount}
                                intlConfig={{ locale: "en-IN", currency: "INR" }}
                                onValueChange={(value) => {
                                    if (value < 1000001)
                                        fd === true
                                            ? setFDAmount(Number(value))
                                            : setAmount(Number(value));
                                }}
                            />
                        </div>
                    </div>
                    <div className={styles.slider}>
                        <Slider
                            value={fd === true ? fdamount : amount}
                            defaultValue={fd === true ? fdamount : amount}
                            max={maxValue}
                            min={minValue}
                            step={100}
                            onChange={(e) => {
                                setAmount(Number(e.target.value));
                                setFDAmount(Number(e.target.value));
                            }}
                            sx={{
                                maxWidth: "575px",
                                width: "39.93vw",

                                height: "0.55vw",
                                // marginTop: "200px",
                                color: "#683FDB",
                                "& .MuiSlider-rail": {
                                    color: "#683FDB" ? "#EBEBEB" : "#683FDB",
                                    height: "0.55vw" ? "0.35vw" : "0.55vw",
                                    cursor: "3.67vw",
                                },
                            }}
                        />
                    </div>
                    <div className={styles.sliderContent}>
                        {fd === false ? (
                            <Typography id={styles.interest} gutterBottom>
                                Expected Rate of Return
                            </Typography>
                        ) : (
                            <Typography id={styles.interest} gutterBottom>
                                Rate of Interest (p.a)
                            </Typography>
                        )}

                        <div className={styles.sipBox}>
                            <div className={styles.sipValue}>
                                <input
                                    type="number"
                                    className={styles.placeholder}
                                    value={fd === true ? fdinterest : interest}
                                    onChange={(e) => {
                                        if (
                                            fd === true ? e.target.value < 7.6 : e.target.value < 25.1
                                        ) {
                                            fd === true
                                                ? setFDInterest(
                                                    Math.round(Number(e.target.value) * 100) / 100
                                                )
                                                : setInterest(
                                                    Math.round(Number(e.target.value) * 100) / 100
                                                );
                                        }
                                    }}
                                ></input>
                            </div>

                        </div>
                    </div>
                    <div className={styles.slider}>
                        <Slider
                            value={fd === true ? fdinterest : interest}
                            max={mutual === true ? maxInterest : maxfdinterest}
                            min={mutual === true ? minInterest : minfdinterest}
                            step={0.1}
                            onChange={(e) => {
                                setInterest(Number(e.target.value));
                                setFDInterest(Number(e.target.value));
                            }}
                            sx={{
                                maxWidth: "575px",
                                width: "39.93vw",
                                height: "0.55vw",

                                color: "#683FDB",
                                "& .MuiSlider-rail": {
                                    color: "#683FDB" ? "#EBEBEB" : "#683FDB",
                                    height: "0.55vw" ? "0.35vw" : "0.55vw",
                                    cursor: "1.67vw",
                                },
                            }}
                        />
                    </div>
                    <div className={styles.sliderContent}>
                        {fd === false ? (
                            <Typography id={styles.tenure} gutterBottom>
                                Time Period
                            </Typography>
                        ) : (
                            <Typography id={styles.tenure} gutterBottom>
                                Investment Duration
                            </Typography>
                        )}
                        <div className={styles.sipBox}>
                            <div className={styles.sipValue}>
                                <input
                                    className={styles.placeholder}
                                    type="number"
                                    value={fd === true ? fdtime : tenure}
                                    onChange={(e) => {
                                        if (e.target.value < 31) {
                                            fd === true
                                                ? setFDTime(Number(e.target.value))
                                                : setTenure(Number(e.target.value));
                                        }
                                    }}
                                ></input>
                            </div>
                        </div>
                    </div>
                    <div className={styles.slider}>
                        <Slider
                            value={fd === true ? fdtime : tenure}
                            // defaultValue={fd === true ? fdtime : tenure}
                            max={maxTenure}
                            min={minTenure}
                            onChange={(e) => {
                                setTenure(e.target.value);
                                setFDTime(e.target.value);
                            }}
                            sx={{
                                maxWidth: "575px",
                                width: "39.93vw",
                                height: "0.55vw",

                                color: "#683FDB",

                                "& .MuiSlider-rail": {
                                    color: "#683FDB" ? "#EBEBEB" : "#683FDB",
                                    height: "0.55vw" ? "0.35vw" : "0.55vw",
                                    cursor: "1.67vw",
                                },
                            }}
                        />
                    </div>
                </div>
                <div className={styles.graph}>

                    <div className={styles.belowDetails}>
                        <div className={styles.investmentValue}>
                            <span className={styles.ivCircle}></span>
                            <span className={styles.belowText}>Investment&nbsp;Value:</span>
                            <span className={styles.belowAmount}>
                                {fd === true
                                    ? fdamount.toLocaleString("en-IN")
                                    : amount.toLocaleString("en-IN")}
                            </span>
                        </div>
                        <div className={styles.futureValue}>
                            <span className={styles.fvCircle}></span>
                            <span className={styles.belowText}>Future&nbsp;Value:</span>
                            <span className={styles.belowAmount}>
                                {fd === true
                                    ? fdValue.toLocaleString("en-IN")
                                    : mfValue.toLocaleString("en-IN")}
                            </span>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Partnership
